import React, {useEffect, useRef, useState} from 'react';
import {Alert, Dimensions, Image, RefreshControl, StyleSheet, TouchableOpacity, View} from 'react-native';
import {useDispatch, useSelector} from 'react-redux';
import userApi from '../../api/userApi';
import {setCartAmount, setProfile, setToken} from '../../redux/actions';
import GlobalStyles from '../../utils/styles/GlobalStyles';
import profile from './Profile';
import {
    Center,
    Pressable,
    Badge,
    Box,
    Column,
    Row,
    Text,
    Button,
    Spinner,
    FlatList,
    Input, Toast,
} from 'native-base';
import {Spacer} from 'native-base/src/components/primitives/Flex';
import storeApi from '../../api/storeApi';
import CommonFunction from '../../utils/CommonFunction';
import {Icon} from 'react-native-elements';
import cartApi from '../../api/cartApi';
const {width, height} = Dimensions.get('screen');

const data = [
    {
        imageId: 1,
        image: ""
    },
    {
        imageId: 2,
        image: ""
    },
    {
        imageId: 3,
        image: ""
    }
]


const Home = ({navigation, props}) => {
    const [productData, setProductData] = useState({ data: [] });
    const [totalPage, setTotalPage] = useState(0);
    const [page, setPage] = useState(1);
    const [spinner, setSpinner] = useState(true);
    const [flatListRefresh, setFlatListRefresh] = useState(false);
    const userToken = useSelector((state) => state.reducer.token)
    const dispatch = useDispatch()

    useEffect( () => {
        navigation.addListener('focus', () => {
            getAllProduct();
        })
        navigation.addListener('beforeRemove', (e) => {
            e.preventDefault();
        });
    }, [navigation]);

    const checkCartAmount = async () => {
        try {
            let result = await cartApi.getCart(userToken);
            if (result.data.status == 200) {
                dispatch(setCartAmount(result.data.payload.productList.length));
            } else {
                Alert.alert('Error', 'Something is wrong!', [{text: 'OK'}]);
            }
        } catch (error) {
            Alert.alert('Error', error.toString(), [{text: 'OK'}]);
            console.log(error);
        }
    }

    const onAddToCartPressHandle = async (id) => {
        if (await CommonFunction.addToCart(id, 1, userToken)){
            await checkCartAmount();
        }
    }

    const getAllProduct = async () => {
        try {
            let result = await storeApi.getAllProduct(1,5);
            if (result.status == 200) {
                setProductData( productData => ({
                    data: result.data.data
                }));
                setTotalPage(result.data.totalPage)
                setPage(result.data.page)
                setSpinner(false);
            } else {
                Alert.alert('Error', 'Something is wrong!', [{text: 'OK'}]);
                setSpinner(false);
            }
        } catch (error) {
            Alert.alert('Error', error.toString(), [{text: 'OK'}]);
            console.log(error);
        }
    }

    const getMore = async () => {
        try {
            if (page < totalPage) {
                setFlatListRefresh(true);
                let result = await storeApi.getAllProduct(page + 1, 5);
                if (result.status == 200) {
                    for (let product of result.data.data) {
                        setProductData(productData => ({
                            data: [...productData.data, product]
                        }));
                    }
                    setPage(result.data.page);
                    setFlatListRefresh(false);
                } else {
                    Alert.alert('Error', 'Something is wrong!', [{text: 'OK'}]);
                    setFlatListRefresh(false);
                    setSpinner(false);
                }
            }
        } catch (error) {
            Alert.alert('Error', error.toString(), [{text: 'OK'}]);
            console.log(error);
        }
    }

    const onItemPressHandle = (item) => {
        navigation.navigate('ProductDetail', {
            itemDetail: item
        })
    }
    return (
        <Column flex={1}>
            <Row style={styles.searchBar}>
                <Input variant={'rounded'}
                       margin={1}
                       padding={3}
                       width={'90%'}
                       placeholder={'Search'}
                       placeholderTextColor={'#ffffff'}
                       InputLeftElement={<Icon color={'#ffffff'} name={'search'} style={{marginLeft: 10}}></Icon>}
                ></Input>
            </Row>
            <Box height={150}>
                <FlatList style={{flex: 1}}
                          horizontal
                          pagingEnabled
                          showsHorizontalScrollIndicator={false}
                          data={data}
                          renderItem={({item}) => {
                              return (
                                  <View style={styles.carouselItem}>
                                      <Image style={styles.carouselImage} source={{uri: 'data:image/jpeg;base64,' + item.image}}/>
                                  </View>)
                          }}
                />
            </Box>
            {
                spinner ?
                    <Spinner size="lg" color={'#ff0000'}/> : null
            }
            {
                productData != null && !spinner ?
                    <FlatList
                        data={productData.data}
                        contentContainerStyle={{padding: 15}}
                        refreshControl={
                            <RefreshControl refreshing={flatListRefresh} onRefresh={getAllProduct}/>
                        }
                        onEndReachedThreshold={0.5}
                        onEndReached={getMore}
                        renderItem={({item}) =>
                            <Pressable _pressed={{transform: [{scale: 0.9}]}} onPress={() => onItemPressHandle(item)} style={styles.item}>
                                {
                                    item.new ? <Badge colorScheme="danger" rounded={5} mb={-3.5} mt={-2.5} mr={-1.5} zIndex={2} alignSelf={'flex-end'}>New Product</Badge>
                                        : null
                                }
                                <Column>
                                    <Row space={5}>
                                        {
                                            item.image != null ?
                                                <Image style={styles.image} source={{uri: 'data:image/jpeg;base64,' + item.image[0].image}}></Image> :
                                                <Image style={styles.image} source={require('../../images/GGexamplelogo.jpg')}></Image>
                                        }
                                        <Column space={3} marginTop={5} marginRight={3} flex={0.5}>
                                            <Text flexWrap={'wrap'} color={'#000000'} fontSize={14} fontWeight={'bold'}>{item.name}</Text>
                                            <Text color={'#000000'} fontSize={14} fontWeight={'bold'}>Brand: {item.brand}</Text>
                                            <Text color={'#ff0000'} fontSize={20} fontWeight={'bold'}>{CommonFunction.numberWithCommas(item.price)} Đ</Text>
                                            <Button flexDirection={'row'}
                                                    onPress={(e) => {
                                                        onAddToCartPressHandle(item.id)
                                                    }}
                                                    leftIcon={<Icon color={'#ffffff'} name={'add-shopping-cart'}></Icon>}
                                                    backgroundColor={'#000000'}
                                                    _pressed={{
                                                        backgroundColor: '#1fd000'
                                                    }}
                                                    borderRadius={15}
                                            >Add to cart</Button>
                                        </Column>
                                    </Row>
                                </Column>
                            </Pressable>}>
                    </FlatList> : null
            }
        </Column>
    );
}

const styles = StyleSheet.create({
    item: {
        flex: 1,
        height: 200,
        marginTop: 20,
        backgroundColor: 'white',
        borderRadius: 15,
        elevation: 5,
    },
    image: {
        flex: 0.6,
        height: 200,
        width: 200,
        borderBottomLeftRadius: 15,
        borderTopLeftRadius: 15,
    },
    searchBar: {
        justifyContent: 'center',
        height: 50,
        backgroundColor: '#ff0000',
    },
    carouselItem : {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        width
    },
    carouselImage: {
        height: width * 1,
        width: width * 1,
        resizeMode: 'cover'
    }
});

export default Home;
